import Navibar from '../layout/Navi'
import React from 'react'
import Typography from '@material-ui/core/Typography';
import { Button } from 'react-bootstrap';
import Icon from '@material-ui/core/Icon';
import { Input } from '@material-ui/core';
import {Link} from 'react-router-dom'
import { useForm } from "react-hook-form";


export default function Working(){
    const { register, handleSubmit } = useForm();

    const onSubmit = data => {
        console.log(data);
    };
    const data=[
        {
            title:'How The Rooster Found His Sound',
            language:'English',
        },
        {
            title:'How The Rooster Found His Sound',
            language:'Lao',
        },
        {
            title:'How The Rooster Found His Sound',
            language:'Tetun',
        },

    ]
    return(
        <div>
            <Navibar />
            <div style={topcontainer}>
                <Typography component="h1" variant="h2" align="center" style={{ color: 'white' }} >
                    Exist version
                </Typography>
                <Typography variant="h5" align="center" style={subheadding} >
                    In this page, you can check the whether the book was translated already
                </Typography>
                <div >
                    <form autoComplete='off' onSubmit={handleSubmit(onSubmit)} style={{ display: 'inline-block', marginLeft: "10%", marginTop: '20px', marginBottom: '-15px' }}>
                        <input style={input_field}
                            name="Level"
                            ref={register}
                            placeholder="Input Level"
                        />
                        <Button type='submit' style={{ marginLeft: '30px',borderRadius:'20px' }}>Search</Button>
                    </form>
                </div>
            </div>
            <div style={{display:'flex',flexWrap:'nowarp',justifyContent:'space-around'}}>
                {data.map((version)=>(
                    <span>{version.language}</span>
                ))}
            </div>
        </div>
    )
}
const topcontainer={
    backgroundColor:'#273746',
    paddingTop:'100px',
    paddingBottom:'50px',
    paddingLeft:'300px',
    paddingRight:'300px',
    
}
const subheadding={
    color:'white',
    marginTop:'50px',
    marginLeft:'200px',
    marginRight:'200px'
}


const input_field = {
    width: '200px',
    marginLeft: '100px',
    color: 'white'
}
